import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
import { useState } from 'react';

const emptyclass = () => {
    const navigate = useNavigate();
    const [activeBuilding, setActiveBuilding] = useState(null);
    const [activeTime, setActiveTime] = useState(null);
    const [buttonStyle, setButtonStyle] = useState({});
    const [activeDay, setActiveDay] = useState(null);
    const [activeWeek, setActiveWeek] = useState(null);
    function handleTimeClick(timeId) {
        setActiveTime(timeId);
        setButtonStyle({
            backgroundColor: 'rgb(246,195,66)',
            color: 'white'
        });
    }
    function handleDayClick(dayId) {
        setActiveDay(dayId);
        setButtonStyle({
            backgroundColor: 'rgb(246,195,66)',
            color: 'white'
        });
    }
    function handleWeekClick(weekId) {
        setActiveWeek(weekId);
        setButtonStyle({
            backgroundColor: 'rgb(246,195,66)',
            color: 'white'
        });
    }
    function emptyHandler() {
        navigate("/home/")
    }
    function handleBuildingClick(buildingId) {
        setActiveBuilding(buildingId);
        setButtonStyle({
            backgroundColor: 'rgb(246,195,66)',
            color: 'white'
        });
    }
    // axios({
    //     method: "get",
    //     url: '/api/empty_room',
    //     headers: {
    //         "Content-Type": 'application/form-data',
    //         "traefik": "jwzx",
    //     },
    // }).then(res => {
    //     console.log(res);
    // }, err => {
    //     console.log(err)
    // });

    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            {activeBuilding === 'build2' && <div className="emptychoice" id="build2">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build3' && <div className="emptychoice" id="build3">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build4' && <div className="emptychoice" id="build4">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
                <div className="floordiv" id="f6div"><img src={require("./emptypic/6f.jpg")} id="f6" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build5' && <div className="emptychoice" id="build5">
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>}
            {activeBuilding === 'build8' && <div className="emptychoice" id="build8">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
            </div>}
            <div id="classchoice">
                <div className="choicediv">
                    <div className="btndiv"><button id="btnbuild2" className="buildingbtn" onClick={() => handleBuildingClick('build2')} style={activeBuilding === 'build2' ? buttonStyle : {}}>二教</button></div>
                    <div className="btndiv"><button id="btnbuild3" className="buildingbtn" onClick={() => handleBuildingClick('build3')} style={activeBuilding === 'build3' ? buttonStyle : {}}>三教</button></div>
                    <div className="btndiv"><button id="btnbuild4" className="buildingbtn" onClick={() => handleBuildingClick('build4')} style={activeBuilding === 'build4' ? buttonStyle : {}}>四教</button></div>
                    <div className="btndiv"><button id="btnbuild5" className="buildingbtn" onClick={() => handleBuildingClick('build5')} style={activeBuilding === 'build5' ? buttonStyle : {}}>五教</button></div>
                    <div className="btndiv"><button id="btnbuild8" className="buildingbtn" onClick={() => handleBuildingClick('build8')} style={activeBuilding === 'build8' ? buttonStyle : {}}>八教</button></div>
                </div>
                <div className="choicediv">
                    <div className="btndiv"><button id="btn12" className="buildingbtn" onClick={() => handleTimeClick('btn12')} style={activeTime === 'btn12' ? buttonStyle : {}}>1-2节</button></div>
                    <div className="btndiv"><button id="btn34" className="buildingbtn" onClick={() => handleTimeClick('btn34')} style={activeTime === 'btn34' ? buttonStyle : {}}>3-4节</button></div>
                    <div className="btndiv"><button id="btn56" className="buildingbtn" onClick={() => handleTimeClick('btn56')} style={activeTime === 'btn56' ? buttonStyle : {}}>5-6节</button></div>
                    <div className="btndiv"><button id="btn78" className="buildingbtn" onClick={() => handleTimeClick('btn78')} style={activeTime === 'btn78' ? buttonStyle : {}}>7-8节</button></div>
                    <div className="btndiv"><button id="btn910" className="buildingbtn" onClick={() => handleTimeClick('btn910')} style={activeTime === 'btn910' ? buttonStyle : {}}>9-10节</button></div>
                    <div className="btndiv"><button id="btn1112" className="buildingbtn" onClick={() => handleTimeClick('btn1112')} style={activeTime === 'btn1112' ? buttonStyle : {}}>11-12节</button></div>
                </div>
                <div className="choicediv">
                <div className="btndiv"><button id="mon" className="buildingbtn" onClick={() => handleDayClick('mon')} style={activeDay === 'mon' ? buttonStyle : {}}>周一</button></div>
    <div className="btndiv"><button id="tes" className="buildingbtn" onClick={() => handleDayClick('tes')} style={activeDay === 'tes' ? buttonStyle : {}}>周二</button></div>
    <div className="btndiv"><button id="wed" className="buildingbtn" onClick={() => handleDayClick('wed')} style={activeDay === 'wed' ? buttonStyle : {}}>周三</button></div>
    <div className="btndiv"><button id="thr" className="buildingbtn" onClick={() => handleDayClick('thr')} style={activeDay === 'thr' ? buttonStyle : {}}>周四</button></div>
    <div className="btndiv"><button id="fri" className="buildingbtn" onClick={() => handleDayClick('fri')} style={activeDay === 'fri' ? buttonStyle : {}}>周五</button></div>
    <div className="btndiv"><button id="sat" className="buildingbtn" onClick={() => handleDayClick('sat')} style={activeDay === 'sat' ? buttonStyle : {}}>周六</button></div>
    <div className="btndiv"><button id="sun" className="buildingbtn" onClick={() => handleDayClick('sun')} style={activeDay === 'sun' ? buttonStyle : {}}>周天</button></div>
                </div>
                <div className="btndiv"><button id="week" className="buildingbtn" onClick={() => handleWeekClick('week')} style={activeWeek === 'week' ? buttonStyle : {}}>第二十周</button></div>
                    <div className="btndiv"><button id="week" className="buildingbtn" >第二十周</button></div>
            </div>
        </div>)
}
export default emptyclass;
